import React from 'react'; // Add any other necessary import statements
import { Button } from '@material-ui/core';
import './App.css';
import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import processImg from '../src/processImg.svg';

function Process() {
  return (
    <Container maxWidth="xl" style={{ background: '#F2E7D6', position: 'relative', padding: '2rem' }}>
      <Grid container spacing={4} alignContent="center" alignItems="center" justifyContent="center" style={{ position: 'relative' }}>
        <Grid item xs={12} sm={8}>
          <h1 style={{ fontSize: '4rem', fontFamily: 'yeseva one', position: 'relative' }}>
            The Process
          </h1>
        </Grid>
        <Grid item xs={12} sm={4}>
          <img className="my-svg" src={processImg} height="150px" style={{ position: 'relative' }} alt="Process" />
        </Grid>
      </Grid>
      <hr style={{ width: '100%', borderColor: 'black' }} />
      <Grid container spacing={4} justifyContent="center">
        <Grid item xs={12} sm={8}>
          <Box p={0}>
            <p style={{ lineHeight: '30px', fontFamily: 'josefin sans', fontSize: '1.5rem', position: 'relative' }}>
              A customer-oriented consulting process. Whatever the challenge, time frame, and budget, I can help you on your journey to success.
              A process with the ultimate goal of making you happy.
            </p>
          </Box>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Process;
